    public function testGetAudioAnalysisForATrack(): void
    {
        $body = file_get_contents(__DIR__ . '/../../Mocks/Audio/analysis.json');

        $stream = $this->createMock(StreamInterface::class);
        $stream->method('__toString')->willReturn($body);

        $response = $this->createMock(AudioAnalysisResponse::class);
        $response->method('getBody')->willReturn($stream);
        $response->method('getHeader')->willReturn(['content-type' => 'json']);
        $response->method('getStatusCode')->willReturn(200);

        $client = $this->createMock(ClientInterface::class);
        $client->method('sendRequest')->willReturn($response);

        $spotify = new Spotify($this->oauthToken, $client);
        $response = $spotify->audio()->analysis('11dFghVXANMlKmJXsNCbNl');

        $audioAnalysis = $response->getAudioAnalysis();

        $meta = $audioAnalysis->getMeta();
        $this->assertSame('4.0.0', $meta->getAnalyzerVersion());
        $this->assertSame('Linux', $meta->getPlatform());
        $this->assertSame('OK', $meta->getDetailedStatus());
        $this->assertSame(0, $meta->getStatusCode());
        $this->assertSame(1495193577, $meta->getTimestamp());
        $this->assertSame(6.93906, $meta->getAnalysisTime());
        $this->assertSame('libvorbisfile L+R 44100->22050', $meta->getInputProcess());

        $track = $audioAnalysis->getTrack();
        $this->assertSame(4585515, $track->getNumSamples());
        $this->assertSame(207.95986, $track->getDuration());
        $this->assertEmpty($track->getSampleMd5());
        $this->assertSame(0, $track->getOffsetSeconds());
        $this->assertSame(0, $track->getWindowSeconds());
        $this->assertSame(22050, $track->getAnalysisSampleRate());
        $this->assertSame(1, $track->getAnalysisChannels());
        $this->assertSame(0.0, $track->getEndOfFadeIn());
        $this->assertSame(201.13705, $track->getStartOfFadeOut());
        $this->assertSame(-2.743, $track->getLoudness());
        $this->assertSame(114.944, $track->getTempo());
        $this->assertSame(0.74, $track->getTempoConfidence());
        $this->assertSame(4.0, $track->getTimeSignature());
        $this->assertSame(0.994, $track->getTimeSignatureConfidence());
        $this->assertSame(2.0, $track->getKey());
        $this->assertSame(0.408, $track->getKeyConfidence());
        $this->assertSame(1.0, $track->getMode());
        $this->assertSame(0.485, $track->getModeConfidence());
