    public function testGetAudioFeaturesForATrack(): void
    {
        $body = file_get_contents(__DIR__ . '/../../Mocks/Audio/single-audio-features.json');

        $stream = $this->createMock(StreamInterface::class);
        $stream->method('__toString')->willReturn($body);

        $response = $this->createMock(AudioFeaturesResponse::class);
        $response->method('getBody')->willReturn($stream);
        $response->method('getHeader')->willReturn(['content-type' => 'json']);
        $response->method('getStatusCode')->willReturn(200);

        $client = $this->createMock(ClientInterface::class);
        $client->method('sendRequest')->willReturn($response);

        $spotify = new Spotify($this->oauthToken, $client);
        $response = $spotify->audio()->features('11dFghVXANMlKmJXsNCbNl');

        $this->assertInstanceOf(AudioFeatures::class, $response->getAudioFeatures());
        $this->assertSame(0.696, $response->getAudioFeatures()->getDanceability());
        $this->assertSame(0.905, $response->getAudioFeatures()->getEnergy());
        $this->assertSame(2, $response->getAudioFeatures()->getKey());
        $this->assertSame(-2.743, $response->getAudioFeatures()->getLoudness());
        $this->assertSame(1, $response->getAudioFeatures()->getMode());
        $this->assertSame(0.103, $response->getAudioFeatures()->getSpeechiness());
        $this->assertSame(0.011, $response->getAudioFeatures()->getAcousticness());
        $this->assertSame(0.000905, $response->getAudioFeatures()->getInstrumentalness());
        $this->assertSame(0.302, $response->getAudioFeatures()->getLiveness());
        $this->assertSame(0.625, $response->getAudioFeatures()->getValence());
        $this->assertSame(114.944, $response->getAudioFeatures()->getTempo());
        $this->assertSame('audio_features', $response->getAudioFeatures()->getType());
        $this->assertSame('11dFghVXANMlKmJXsNCbNl', $response->getAudioFeatures()->getId());
        $this->assertSame('spotify:track:11dFghVXANMlKmJXsNCbNl', $response->getAudioFeatures()->getUri());
        $this->assertSame('https://api.spotify.com/v1/tracks/11dFghVXANMlKmJXsNCbNl',
            $response->getAudioFeatures()->getTrackHref());
        $this->assertSame('https://api.spotify.com/v1/audio-analysis/11dFghVXANMlKmJXsNCbNl',
            $response->getAudioFeatures()->getAnalysisUrl());
        $this->assertSame(207960, $response->getAudioFeatures()->getDurationMs());
        $this->assertSame(4, $response->getAudioFeatures()->getTimeSignature());
    }

    public function testGetAudioFeaturesForTracks(): void
    {
        $body = file_get_contents(__DIR__ . '/../../Mocks/Audio/multiple-audio-features.json');

        $stream = $this->createMock(StreamInterface::class);
        $stream->method('__toString')->willReturn($body);

        $response = $this->createMock(AudioFeaturesResponse::class);
        $response->method('getBody')->willReturn($stream);
        $response->method('getHeader')->willReturn(['content-type' => 'json']);
        $response->method('getStatusCode')->willReturn(200);

        $client = $this->createMock(ClientInterface::class);
        $client->method('sendRequest')->willReturn($response);

        $spotify = new Spotify($this->oauthToken, $client);
        $response = $spotify->audio()->features([
            '7ouMYWpwJ422jRcDASZB7P',
            '4VqPOruhp5EdPBeR92t6lQ',
            '2takcwOaAZWiXQijPHIx7B',
        ]);

        $this->assertContainsOnlyInstancesOf(AudioFeatures::class, $response->getAudioFeatures());
    }
}
